import React, {Component} from 'react';
import UserForm2 from "./UserForm2";
import UserList from "./UserList";

class MainPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            users: [{"id": 1, "name": "Johssssssn", "surname": "Doe", "age": 54, "email": "empty"},
                {"id": 2, "name": "Johnтн", "surname": "Depp", "age": 58, "email": "super@email.com"}]
        };
        //this.removeUser = this.removeUser.bind(this);
    }

    removeUser(id) {
        alert(id + "asda")
        const user = {"id": 1, "name": "Johssn111", "surname": "Doe", "age": 54, "email": "empty"};
        let updatedUsers = [...this.state.users, user];
        alert(updatedUsers[3].name)
        this.setState({users: updatedUsers});
    }

    render() {
        document.body.style.backgroundColor = "rgba(167,165,74,0.35)";
        return (
            <div align={"center"}>
                <UserForm2/>
                <UserList value={this.state.users} changeValue={this.removeUser} />
            </div>
        )
    }
}

export default MainPage;
